import TableItem from "./TableItem";
import React from "react";

const Table = () => {
  return (
    <div>
      <table className="result">
        <thead>
          <tr>
            <th>Year</th>
            <th>Total Savings</th>
            <th>Interest (Year)</th>
            <th>Total Interest</th>
            <th>Invested Capital</th>
          </tr>
        </thead>
        <tbody>
        <TableItem></TableItem>
      </tbody></table>
    </div>
  );
};

export default Table;
